void PDPEmulator::tick()
{
	uint16 command = _ROM[_PC * 3 + 0];
	uint16 arg1    = _ROM[_PC * 3 + 1];
	uint16 arg2    = _ROM[_PC * 3 + 2];


	_PC += 1;


	switch (command)
	{
		case(MOV):
			mov(arg1, arg2);
			break;
		case(ADD):
			add(arg1, arg2);
			break;
		case(SUB):
			sub(arg1, arg2);
			break;
		case(CMP):
			cmp(arg1, arg2);
			break;
		case(BNEI):
			bnei(arg1, arg2);
			break;
		case(BIS):
			bis(arg1, arg2);
			break;
		case(MOVI):
			movi(arg1, arg2);
			break;
		case(MOVP1):
			movp1(arg1, arg2);
			break;
		case(MOVP2):
			movp2(arg1, arg2);
			break;
		case(MOVPA):
			movpa(arg1, arg2);
			break;
		case(MOVP1I):
			movp1i(arg1, arg2);
			break;
		case(ADDI):
			addi(arg1, arg2);
			break;
		case(CMPI):
			cmpi(arg1, arg2);
			break;
		case(JMP):
			jmp(arg1, arg2);
			break;
		default:
			std::cerr << "OMG! Wrong command" << std::endl;
			break;
	}

}

PDPEmulator::PDPEmulator()
{
	_PC = 0;
}

void PDPEmulator::add(uint16 dest, uint16 source)
{
	_memory[dest] = _memory[dest] + _memory[source];
}

